import React from 'react';
import logo from '../../images/logo.png';
import './Header.css';


const Header = () => {
    return (
        <div className='header'>
           <img src={logo}></img> 
           <nav>
                <a href='/logo'>Shop</a>
                <a href='/review'>Order review</a>
                <a href='/inventory'>Manage Inventory</a>
           </nav>
        </div>
    );
};

export default Header;
